import React from 'react';
import './App.css';
import AppBar from '@material-ui/core/AppBar';

function App() {
  return (
    <div className="app">

      <AppBar className="header-bar" style={{"background-color":"#272e2b"}}>
        <div className="header-title"> Puzzle and Dungeons </div>
      </AppBar>
      <div className="body">
        <div className="title">
          Puzzle and Dungeons
        </div>
      </div>
    </div>
  );
}

export default App;
